import React,{Component} from 'react';

const placeOrder = "http://localhost:7600/order";;


class ViewOrder extends Component {

    constructor(props){
        super()

        this.state={
            order:''
        }
    }

    render(){
        return(
            <h1>ViewOrder</h1>
        )
    }
    componentDidMount(){
        axios.get(placeOrder).then((res) => {this.setState({order:res})})
    }
}

export default ViewOrder;
